import React from 'react';
import { Header, List } from 'semantic-ui-react';

class Portfolio extends React.Component {
  render(){
    return (
      <div className='portfolio'>
        <div className='links'>
          <Header as='h4' disabled={true}>Portfolio</Header>
          <Header as='h4' >Transactions</Header>
        </div>
      </div>
    )
  };
};

export default Portfolio; 

<List horizontal>
  <List.Item>Portfolio |</List.Item>
  <List.Item onClick={() => props.changeURL("/transactions")}>Transactoins</List.Item>
  <List.Item onClick={() => props.changeURL("/profile")} id="nav-link">Profile |</List.Item>
  <List.Item onClick={() => removeLocalStorageToken()} id="nav-link">Log Out</List.Item>
</List>
